INSERT INTO `appointment_format` (`id`, `name`, `format`, `format_2`) VALUES
(1, 'Text', '<p style=\"text-align:center\"><samp><span style=\"font-size:14px\"><u><span style=\"font-family:arial,helvetica,sans-serif\"><strong>Appointment Letter</strong></span></u></span></samp></p>\r\n\r\n<p><br />\r\n<samp><span style=\"font-size:12px\">Date - <strong>{{today_date}}</strong><br />\r\nDear: <strong>{{candidate_name}},</strong><br />\r\nEmployee Code: <strong>{{emp_code}}</strong></span></samp><br />\r\n<br />\r\n<samp><span style=\"font-size:12px\">With reference to your application and subsequent discussion, it gives us immense pleasure to offer you an appointment in <strong>Prakhar Software Solutions Pvt.&nbsp;Ltd.</strong> This is in reference to your employment engagement for some of our eGovernance projects in Delhi&nbsp;State.<br />\r\nDetails of Terms and Conditions:</span></samp></p>\r\n\r\n<ol>\r\n	<li><em>We are pleased to inform you that you have been selected for the post of </em><strong>{{designation}}</strong><em> GeM (Government e-Market) project.</em></li>\r\n	<li><em>Your &ldquo;Annual compensation&rdquo; is attached herewith as in Annexure-A</em></li>\r\n	<li><em>Your employment with us will be governed by terms and conditions referred in Annexure-B</em></li>\r\n	<li><em>Please sign in the duplicate copy of this letter (Photo copy enclosed) on all the sheets at the bottom on the left corner, and return to the Human resource Department of our Corporate Office at Delhi. </em></li>\r\n</ol>\r\n\r\n<p><samp><span style=\"font-size:12px\">We welcome you to Prakhar Software Solutions Pvt.&nbsp;Ltd. and look forward to a long term association.</span></samp></p>\r\n\r\n<p><samp><span style=\"font-size:12px\"><strong>Salary Structure</strong></span></samp></p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:602px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:602px\"><samp><span style=\"font-size:12px\"><strong>Annual Cost to Company&nbsp; {{sal_ctc}}*12 = {{ctc_pa}} Lakh</strong></span></samp></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:607px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\"><strong>Earning Components</strong></span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\"><strong>Amount</strong></span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\"><strong>Deductions</strong></span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\"><strong>Amount</strong></span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Basic</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{basic}}</span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\">PF(Employee)</span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\">{{sal_pf_emmployee}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">HRA</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{hra}}</span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\">ESI(Employee)</span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\">{{sal_esi_employee}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Conveyance</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{conveyance}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Telephone Allowance</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_telephone}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Medical Allowance</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_pa}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\">Special Allowance</td>\r\n			<td style=\"width:186px\">{{sal_special_allowance}}</td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Total Earning</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_gross}}</span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\">Total Deduction</span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\">{{deduction}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Net Pay</span></samp></td>\r\n			<td colspan=\"3\" style=\"width:479px\"><samp><span style=\"font-size:12px\">Rs.{{sal_net}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">In words</span></samp></td>\r\n			<td colspan=\"3\" style=\"width:479px\"><samp><span style=\"font-size:12px\">{{word}}</span></samp></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:607px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:501px\"><samp><span style=\"font-size:12px\">Employer&rsquo;s Contribution to PF</span></samp></td>\r\n			<td style=\"width:106px\"><samp><span style=\"font-size:12px\">{{sal_pf_employer}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:501px\"><samp><span style=\"font-size:12px\">Employer&rsquo;s Contribution to ESI</span></samp></td>\r\n			<td style=\"width:106px\"><samp><span style=\"font-size:12px\">{{sal_esi_employer}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:501px\"><samp><span style=\"font-size:12px\">Other Benefits Bonus</span></samp></td>\r\n			<td style=\"width:106px\"><samp><span style=\"font-size:12px\">&nbsp;{{sal_bonus}}</span></samp></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><samp><span style=\"font-size:12px\">For <strong>Prakhar Software Solutions Pvt.&nbsp;Ltd.</strong><br />\r\nDeo Kumar<br />\r\nSr. Manager &ndash; <a href=\"https://www.linkedin.com/profile/view?id=AAMAAALfgh4BU3MByY-Hr5AtmM-VtV4TGu83MVE&amp;trk=hp-identity-headline\">HR &amp; Talent Acquisition</a></span></samp></p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p style=\"text-align:center\"><span style=\"font-size:14px\"><samp><strong><u>Annexure-B</u></strong></samp></span></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><samp>General Terms and Conditions of Employment.</samp></span></p>\n\n<ol>\n	<li><span style=\"font-size:12px\"><samp>You are initially appointed to work at Client location. However, you are liable to be transferred to any department or establishment forming part of the Company, or any Group Company, anywhere in India, temporarily or permanently. Working Days / Hours may vary based on the client requirements. And will be informed by the client</samp></span></li>\n	<li><span style=\"font-size:12px\"><samp>If you undergo training abroad and / or in India for which the company incurs considerable efforts / cost for any project specific requirement etc. you might be required to sign an agreement as a token of commitment, the terms of which will be decided by the company depending on the training period, location, travelling cost, lodging, boarding and other expenses incidental to the training.</samp></span></li>\n	<li><span style=\"font-size:12px\"><samp>Rules &ndash; General:- During the term of employment, you will employ yourself efficiently, honestly, faithfully and to the best of your ability and shall devote your whole time and attention to promote the interest of the company and generally carry out duties and work as assigned to you. You shall obey and comply with all the lawful orders and directions given to you by your reporting Manager &amp; concerned superior in the Client organization.</samp></span></li>\n	<li><span style=\"font-size:12px\"><samp>You will not indulge into unprofessional practices and in case, it is found that while you are not following client organization&rsquo;s policies, rules and guidelines, the company would be at liberty to take disciplinary and legal action against you.</samp></span></li>\n	<li><span style=\"font-size:12px\"><samp>Transfer and Deployment:- you may be transferred to any other location in such capacity as the Company may from time to time determine or any department, establishment, factory or branch of the Company or its affiliate, associate or subsidiary. In such cases, you will be governed by the terms and conditions of services applicable to the new assignment.</samp></span></li>\n	<li><span style=\"font-size:12px\"><samp>This engagement is terminable with a thirty days&rsquo; notice period from both the sides. </samp></span></li>\n	<li><span style=\"font-size:12px\"><samp>In case you are found engaged in doing any work other than the task assigned to you or is found not useful to the project or you leave the project without any notice, your contract will be terminated. If you damage any equipment, property and third party liabilities, your contract will be terminated reserving the rights for compensation of damages that are incurred. </samp></span></li>\n	<li><span style=\"font-size:12px\"><samp>This document is highly confidential, and sharing of this document with anybody such as colleagues, Client etc., will lead to terminate of your employment without notice.</samp></span></li>\n	<li><span style=\"font-size:12px\"><samp>The post is temporary for a probationary period of three months, after which it would be made permanent depending upon performance of candidate.</samp></span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><samp><strong>Declaration:</strong> I &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;........S/o /D/o /W/o&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;.Sincerely assure you to maintain complete discipline and do my best to perform my duties. I also authorize the management of Prakhar Software Solutions Pvt Ltd to ask me to leave any time without any notice, in case of any misconduct on my part or if I am found violating any rules and regulations laid by the company from time to time or fail to meet the defined performance standards during the training and employment. </samp></span></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"font-size:12px\"><samp>Candidate Name/Signature)&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;..&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Date&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;...</samp></span></p>\n\n<p>&nbsp;</p>\n\n<p style=\"text-align: center;\"><span style=\"font-size:12px\"><samp>(Save Papers save Trees)</samp></span></p>\n'),
(2, 'BECIL', '<p style=\"text-align:center\"><strong><em><u>Offer of Appointment</u></em></strong></p>\r\n\r\n<p><samp><span style=\"font-size:12px\">Date - <strong>{{today_date}}</strong><br />\r\nDear&nbsp;<strong>{{candidate_name}},</strong><br />\r\nEmployee Code: <strong>{{emp_code}}</strong></span></samp></p>\r\n\r\n<p><em>With reference to your application and subsequent discussion, it gives us immense pleasure to offer you an appointment in <strong>Prakhar Software Solutions Pvt Ltd.</strong></em></p>\r\n\r\n<p><em>This is in reference to your employment engagement with us under our Empanelment with Broadcast Engineering Consultants India Limited (BECIL) for Providing Professional Support Services / Manpower Staffing and IT consulting for our On-going &amp; Up-coming eGovernance &amp; IT related Projects on contractual basis.</em></p>\r\n\r\n<p><samp><span style=\"font-size:12px\">Details of Terms and Conditions:</span></samp></p>\r\n\r\n<ol>\r\n	<li><em>We are pleased to inform you that you have been selected for the post of </em><strong>{{designation}}</strong> <em>for one of our esteemed clients.</em></li>\r\n	<li><em>Your &ldquo;Annual compensation&rdquo; is attached herewith as in Annexure-A</em></li>\r\n	<li><em>Your employment with us will be governed by terms and conditions referred in Annexure-B </em></li>\r\n	<li><em>Your services are effective from the date of your joining </em>{{doj}}<em>.</em></li>\r\n	<li><em>Please sign in the duplicate copy of this letter (Photocopy enclosed) on all the sheets at the bottom on the left corner, and return to the Human resource Department of our Corporate Office at Delhi.</em></li>\r\n</ol>\r\n\r\n<p><em>We welcome you to Prakhar Software Solutions Pvt Ltd and look forward to a long term association. </em></p>\r\n\r\n<p><samp><span style=\"font-size:12px\"><strong>Salary Structure</strong></span></samp></p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:607px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"4\">\r\n			<p><samp><span style=\"font-size:12px\"><strong>Annual Cost to Company&nbsp; {{sal_ctc}}*12 = {{ctc_pa}} Lakh PA</strong></span></samp></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\"><strong>Earning Components</strong></span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\"><strong>Amount</strong></span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\"><strong>Deductions</strong></span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\"><strong>Amount</strong></span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Basic</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{basic}}</span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\">PF(Employee)</span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\">{{sal_pf_emmployee}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">HRA</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{hra}}</span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\">ESI(Employee)</span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\">{{sal_esi_employee}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Conveyance</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{conveyance}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Telephone Allowance</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_telephone}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Medical Allowance</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_pa}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><em><span style=\"font-size:12px\">Special Allowance</span></em></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_special_allowance}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Total Earning</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_gross}}</span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\">Total Deduction</span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\">{{deduction}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Net Pay</span></samp></td>\r\n			<td colspan=\"3\" style=\"width:479px\"><samp><span style=\"font-size:12px\">Rs.{{sal_net}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">In words</span></samp></td>\r\n			<td colspan=\"3\" style=\"width:479px\"><samp><span style=\"font-size:12px\">{{word}}</span></samp></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:607px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:501px\"><samp><span style=\"font-size:12px\">Employer&rsquo;s Contribution to PF</span></samp></td>\r\n			<td style=\"width:106px\"><samp><span style=\"font-size:12px\">{{sal_pf_employer}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:501px\"><samp><span style=\"font-size:12px\">Employer&rsquo;s Contribution to ESI</span></samp></td>\r\n			<td style=\"width:106px\"><samp><span style=\"font-size:12px\">{{sal_esi_employer}}</span></samp></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><samp><span style=\"font-size:12px\">For <strong>Prakhar Software Solutions Pvt.&nbsp;Ltd.</strong></span></samp></p>\r\n\r\n<p><em><samp><span style=\"font-size:12px\"><strong>Deo Kumar</strong></span></samp></em></p>\r\n\r\n<p><em>Head - HR &amp; Operations&nbsp;</em></p>\r\n', '<p style=\"text-align:center\"><span style=\"font-size:14px\"><samp><strong><u>Annexure-B</u></strong></samp></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12px\"><samp>General Terms and Conditions of Employment.</samp></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><em>The candidate is initially appointed to work at the Client location. However, he/she is liable to be transferred to any department or establishment forming part of the Company, or any Group Company, anywhere in India, temporarily or permanently. Working Days / Hours may vary based on the client requirements. And will be informed by the client</em></li>\r\n	<li style=\"text-align:justify\"><em>If he/she undergoes a training abroad and/or in India for which the company incurs considerable efforts/cost for any project specific requirement etc. you might be required to sign an agreement as a token of commitment, the terms of which will be decided by the company depending on the training period, location, travelling cost, lodging, boarding and other expenses incidental to the training.</em></li>\r\n	<li style=\"text-align:justify\"><em>Rules &ndash; General:- During the term of employment, the candidate will employ himself/herself efficiently, honestly, faithfully and to the best of your ability and shall devote your whole time and attention to promote the interest of the company and generally carry out duties and work as assigned to you. You shall obey and comply with all the lawful orders and directions given to him/her by his reporting Manager &amp; concerned superior in the Client organization.</em></li>\r\n	<li style=\"text-align:justify\"><em>Candidate will not indulge into unprofessional practices and in case, it is found that while you are not following client organization&rsquo;s policies, rules and guidelines, the company would be at liberty to take disciplinary and legal action against you.</em></li>\r\n	<li style=\"text-align:justify\"><em>Transfer and Deployment:- you may be transferred to any other location in such capacity as the Company may from time to time determine or any department, establishment, factory or branch of the Company or its affiliate, associate or subsidiary. In such cases, the candidate will be governed by the terms and conditions of services applicable to the new assignment.</em></li>\r\n	<li style=\"text-align:justify\"><em>This engagement is terminable with a fifteen (15) days&rsquo; notice period from employer&rsquo;s side and two (2) months&rsquo; notice period from employee&rsquo;s side. </em></li>\r\n	<li style=\"text-align:justify\"><em>In case the candidate is found engaged in doing any work other than the task assigned to him/her or is found not useful to the project or he/she leaves the project without any notice, his/her contract will be terminated. If he/she damages any equipment, property and third party liabilities, his/her contract will be terminated reserving the rights for compensation of damages that are incurred. </em></li>\r\n	<li style=\"text-align:justify\"><em>This document is highly confidential, and sharing of this document with anybody such as colleagues, Client etc., will lead to terminate of your employment without notice.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em></li>\r\n	<li style=\"text-align:justify\"><em>Working Hours/Leave of Engaged Manpower:- Candidate will be entitled to Casual Leave only as per Govt. Rules. However, they may have to work on weekly off day/holidays as per the requirement for which Compensatory Leave can be sanctioned.</em></li>\r\n	<li style=\"text-align:justify\"><em>Share your monthly MPR with Signed and Stamped from your reporting manager on mpr@prakharsoftwares.com and for any issues please mail on helpdesk@prakharsoftwares.com</em></li>\r\n	<li style=\"text-align:justify\"><em>The professionals will be facilitated by Desktop/laptop etc. for doing the project work. All these have to be returned by them to the concerned department/office before leaving the job. However, if any, doesn&rsquo;t do so the service provider will be responsible to revert the same either from the engaged manpower or by themselves. In this case, the candidate company may seek the fully refundable security deposit from the candidates and on completion of his/her tenure with the company, the same may be returned. </em></li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><em><strong><em>Declaration:</em></strong><em>&nbsp;Every candidate has to sign the below-said declaration.</em></em></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12px\"><samp><strong>Declaration:</strong> I &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;........S/o /D/o /W/o&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;.Sincerely assure you to maintain complete discipline and do my best to perform my duties. I also authorize the management of Prakhar Software Solutions Pvt Ltd to ask me to leave any time without any notice, in case of any misconduct on my part or if I am found violating any rules and regulations laid by the company from time to time or fail to meet the defined performance standards during the training and employment. </samp></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12px\"><samp>Candidate Name/Signature)&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;..&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Date&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;</samp></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:12px\"><samp>(Save Papers save Trees)</samp></span></p>\r\n'),
(3, 'GeM', '<p style=\"text-align:center\"><strong><em><u>Offer of Appointment</u></em></strong></p>\r\n\r\n<p><samp><span style=\"font-size:12px\">Date - <strong>{{today_date}}</strong><br />\r\nDear&nbsp;<strong>{{candidate_name}},</strong><br />\r\nEmployee Code: <strong>{{emp_code}}</strong></span></samp></p>\r\n\r\n<p><em>With reference to your application and subsequent discussion, it gives us immense pleasure to offer you an appointment in <strong>Prakhar Software Solutions Pvt Ltd.</strong></em></p>\r\n\r\n<p><em>This is in reference to your employment engagement with us under our Empanelment with </em><em>Government e-Market</em><em> (GeM) for Providing Professional Support Services / Manpower Staffing and IT consulting for our On-going &amp; Up-coming eGovernance &amp; IT related Projects on a contractual basis.</em></p>\r\n\r\n<p><samp><span style=\"font-size:12px\">Details of Terms and Conditions:</span></samp></p>\r\n\r\n<ol>\r\n	<li><em>We are pleased to inform you that you have been selected for the post of </em><strong>{{designation}}</strong> <em><em>at GeM (Government e-Market) project.</em></em></li>\r\n	<li><em>Your &ldquo;Annual compensation&rdquo; is attached herewith as in Annexure-A</em></li>\r\n	<li><em>Your employment with us will be governed by terms and conditions referred in Annexure-B </em></li>\r\n	<li><em>Your services are effective from the date of your joining </em>{{doj}}<em>.</em></li>\r\n	<li><em>Please sign in the duplicate copy of this letter (Photocopy enclosed) on all the sheets at the bottom on the left corner, and return to the Human resource Department of our Corporate Office at Delhi.</em></li>\r\n</ol>\r\n\r\n<p><em>We welcome you to Prakhar Software Solutions Pvt Ltd and look forward to a long term association. </em></p>\r\n\r\n<p style=\"text-align:center\"><strong><em><u>Annexure- A</u></em></strong>(Salary Structure)</p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:607px\">\r\n	<tbody>\r\n		<tr>\r\n			<td colspan=\"4\">\r\n			<p><samp><span style=\"font-size:12px\"><strong>Annual Cost to Company&nbsp; {{sal_ctc}}*12 = {{ctc_pa}} Lakh PA</strong></span></samp></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\"><strong>Earning Components</strong></span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\"><strong>Amount</strong></span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\"><strong>Deductions</strong></span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\"><strong>Amount</strong></span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Basic</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{basic}}</span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\">PF(Employee)</span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\">{{sal_pf_emmployee}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">HRA</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{hra}}</span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\">ESI(Employee)</span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\">{{sal_esi_employee}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Conveyance</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{conveyance}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Telephone Allowance</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_telephone}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Medical Allowance</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_pa}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><em><span style=\"font-size:12px\">Special Allowance</span></em></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_special_allowance}}</span></samp></td>\r\n			<td style=\"width:159px\">&nbsp;</td>\r\n			<td style=\"width:133px\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Total Earning</span></samp></td>\r\n			<td style=\"width:186px\"><samp><span style=\"font-size:12px\">{{sal_gross}}</span></samp></td>\r\n			<td style=\"width:159px\"><samp><span style=\"font-size:12px\">Total Deduction</span></samp></td>\r\n			<td style=\"width:133px\"><samp><span style=\"font-size:12px\">{{deduction}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">Net Pay</span></samp></td>\r\n			<td colspan=\"3\" style=\"width:479px\"><samp><span style=\"font-size:12px\">Rs.{{sal_net}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:128px\"><samp><span style=\"font-size:12px\">In words</span></samp></td>\r\n			<td colspan=\"3\" style=\"width:479px\"><samp><span style=\"font-size:12px\">{{word}}</span></samp></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table align=\"center\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:607px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:501px\"><samp><span style=\"font-size:12px\">Employer&rsquo;s Contribution to PF</span></samp></td>\r\n			<td style=\"width:106px\"><samp><span style=\"font-size:12px\">{{sal_pf_employer}}</span></samp></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:501px\"><samp><span style=\"font-size:12px\">Employer&rsquo;s Contribution to ESI</span></samp></td>\r\n			<td style=\"width:106px\"><samp><span style=\"font-size:12px\">{{sal_esi_employer}}</span></samp></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><samp><span style=\"font-size:12px\">For <strong>Prakhar Software Solutions Pvt.&nbsp;Ltd.</strong></span></samp></p>\r\n\r\n<p><em><samp><span style=\"font-size:12px\"><strong>Deo Kumar</strong></span></samp></em></p>\r\n\r\n<p><em>Head - HR &amp; Operations&nbsp;</em></p>\r\n', '<p style=\"text-align:center\"><span style=\"font-size:14px\"><samp><strong><u>Annexure-B</u></strong></samp></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12px\"><samp>General Terms and Conditions of Employment.</samp></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><em>The candidate is initially appointed to work at the Client location. However, he/she is liable to be transferred to any department or establishment forming part of the Company, or any Group Company, anywhere in India, temporarily or permanently. Working Days / Hours may vary based on the client requirements. And will be informed by the client</em></li>\r\n	<li style=\"text-align:justify\"><em>If he/she undergoes a training abroad and/or in India for which the company incurs considerable efforts/cost for any project specific requirement etc. you might be required to sign an agreement as a token of commitment, the terms of which will be decided by the company depending on the training period, location, travelling cost, lodging, boarding and other expenses incidental to the training.</em></li>\r\n	<li style=\"text-align:justify\"><em>Rules &ndash; General:- During the term of employment, the candidate will employ himself/herself efficiently, honestly, faithfully and to the best of your ability and shall devote your whole time and attention to promote the interest of the company and generally carry out duties and work as assigned to you. You shall obey and comply with all the lawful orders and directions given to him/her by his reporting Manager &amp; concerned superior in the Client organization.</em></li>\r\n	<li style=\"text-align:justify\"><em>Candidate will not indulge into unprofessional practices and in case, it is found that while you are not following client organization&rsquo;s policies, rules and guidelines, the company would be at liberty to take disciplinary and legal action against you.</em></li>\r\n	<li style=\"text-align:justify\"><em>Transfer and Deployment:- you may be transferred to any other location in such capacity as the Company may from time to time determine or any department, establishment, factory or branch of the Company or its affiliate, associate or subsidiary. In such cases, the candidate will be governed by the terms and conditions of services applicable to the new assignment.</em></li>\r\n	<li style=\"text-align:justify\"><em>This engagement is terminable with a fifteen (15) days&rsquo; notice period from employer&rsquo;s side and two (2) months&rsquo; notice period from employee&rsquo;s side. </em></li>\r\n	<li style=\"text-align:justify\"><em>In case the candidate is found engaged in doing any work other than the task assigned to him/her or is found not useful to the project or he/she leaves the project without any notice, his/her contract will be terminated. If he/she damages any equipment, property and third party liabilities, his/her contract will be terminated reserving the rights for compensation of damages that are incurred. </em></li>\r\n	<li style=\"text-align:justify\"><em>This document is highly confidential, and sharing of this document with anybody such as colleagues, Client etc., will lead to terminate of your employment without notice.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </em></li>\r\n	<li style=\"text-align:justify\"><em>Working Hours/Leave of Engaged Manpower:- Candidate will be entitled to Casual Leave only as per Govt. Rules. However, they may have to work on weekly off day/holidays as per the requirement for which Compensatory Leave can be sanctioned.</em></li>\r\n	<li style=\"text-align:justify\"><em>Share your monthly MPR with Signed and Stamped from your reporting manager on mpr@prakharsoftwares.com and for any issues please mail on helpdesk@prakharsoftwares.com</em></li>\r\n	<li style=\"text-align:justify\"><em>The professionals will be facilitated by Desktop/laptop etc. for doing the project work. All these have to be returned by them to the concerned department/office before leaving the job. However, if any, doesn&rsquo;t do so the service provider will be responsible to revert the same either from the engaged manpower or by themselves. In this case, the candidate company may seek the fully refundable security deposit from the candidates and on completion of his/her tenure with the company, the same may be returned. </em></li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><em><strong><em>Declaration:</em></strong><em>&nbsp;Every candidate has to sign the below-said declaration.</em></em></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12px\"><samp><strong>Declaration:</strong> I &hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;........S/o /D/o /W/o&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;.Sincerely assure you to maintain complete discipline and do my best to perform my duties. I also authorize the management of Prakhar Software Solutions Pvt Ltd to ask me to leave any time without any notice, in case of any misconduct on my part or if I am found violating any rules and regulations laid by the company from time to time or fail to meet the defined performance standards during the training and employment. </samp></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12px\"><samp>Candidate Name/Signature)&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;..&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Date&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;</samp></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:12px\"><samp>(Save Papers save Trees)</samp></span></p>\r\n');
